import React from 'react';

const Footer = () => {
    return (
        <footer>
            <nav class="navbar bg-dark shadow-lg">
            
                <div class="container-fluid">
                    <span id='span1' class="navbar-text text-light">
                        Designed by Abduvakhob | Copiright 2023 
                    </span>
                    <i id='icon' class="bi bi-instagram text-light"><a href='instar'></a></i>
                    
                </div>
            </nav>
        </footer>

    )
}




export default Footer;
